import React from "react";
import './Login.scss'
import {Link} from 'react-router-dom';

function Login(){

    const handleSubmit=(event)=>{
        event.preventDefault();
    }

    return(
        <div className="main-login">
            Login Page <br/>
            <Link to="/Registro">Registro</Link>
                    <div className="login-container">
                      <div classsName = "left-side">
                            <form onSubmit={handleSubmit}>
                            <label for="email1">Correo</label>    
                                <input placeholder="Ingresa tu correo" type="email" id="email1"/>
                            <label for="pwd1">Contraseña</label>    
                                <input placeholder="Ingresa tu contraseña" type="password" id="pwd1"/>
                                <button type= "submit" id="sub_butt">Iniciar sesión</button>
                            </form>
                        <div/>
                     </div>
              <div className= "right-side">
                
              </div>
          </div>
            
        </div>
    )
}

export default Login;
